import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class MySerService {

  URL="https://localhost:7224/swagger/"

  constructor() { }

  SendLocationServe(location:string):Observable<boolean>
  {
    return this.http.post<boolean>(this.URL + "SendLocationServe",location);
  }
  AddMessage(newMessage:Message):Observable<boolean>
  {
    return this.http.post<boolean>(this.URL + "AddMeesage",newMessage);
  }
}
